import React from "react";
import "./moviedetails.css";
import img from "../../Images/slider-Banner.jpg";

function MovieDetails() {
  const styles = {
    background: `url(${img})`,
  };

  return (
    <div className="movie-detail">
      <div className="backdrop-image" style={styles}></div>
    </div>
  );
}

export default MovieDetails;
